"use strict";function randomInt(t,e){return Math.floor(Math.random()*(e-t+1))+t}function generateToken(t){let e="abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ1234567890",n="";for(let r=0;r<t;r++)n+=e[randomInt(0,e.length-1)];return n}function formatTime(){let t="",e=new Date,n=e.getHours(),r=e.getMinutes();return r<10&&(r="0"+r),t+=n>12?(n-=12)+":"+r+" PM":n+":"+r+" AM"}function formatDate(){let t="",e=new Date,n=String(e.getDate()).padStart(2,"0");return t+=String(e.getMonth()+1).padStart(2,"0")+"/"+n+"/"+e.getFullYear()}